// src/Suppliers.js
import React from 'react';

const Suppliers = () => {
  return (
    <div style={{ padding: '20px', backgroundColor: '#f9f9f9' }}>
      <h2 style={{ color: 'blue' }}>Suppliers Page</h2>
      <p>This is the Suppliers component. If you see this, the Suppliers route is working correctly.</p>
    </div>
  );
};

export default Suppliers;
